●アシックスのランニングウインドジャケットです。<br>
●はっ水<br>
・水をはじくための加工を施した素材を使用しています。<br>
※1：防水ではありません。 ※2：経年により劣化することがあります。<br>
●防風<br>
・風を通しにくい素材を使用し、防風効果のあるウエアです。<br>
●再帰反射<br>
・どんなに歪んだ曲面であっても入射してきた方向に光を反射させる性質を持つ素材を、夜間の視認性アップのため部分的に使用しています。<br>
●UVカット<br>
・紫外線防止効果のある素材を使用しています<br>
●軽量<br>
・素材としての重量を軽減する工夫を施した素材を使用し、軽量化に努めたウエアです。<br>
●UPF50+<br>
・UPFとは、ウエアのUVケア指数のこと。その素材でおおった肌が、むき出しの肌に比べて、日光下でどれだけ長く赤くならずにいられるかを表します。例えば日本で夏の1日の日焼けを抑えるには、※UPF15以上が望ましい数値で、UPF50＋はUPF値の最高ランクです（※場所、時間帯、個人差によって日焼けの程度は多少異なります。）<br><br>
■素材<br>
身頃：ライトタフタ／ポリエステル100％<br>
パイピング：ポラレックス／ポリエステル100％<br>
衿裏：起毛メッシュ／ポリエステル100％<br>
